"use client"

import type { Editor } from "@tiptap/react"

import {
  EditorBubbleMenu,
  EditorBubbleMenuButton,
  EditorBubbleMenuContent,
  EditorBubbleMenuForm,
  EditorBubbleMenuFormActions,
  EditorBubbleMenuFormCancel,
  EditorBubbleMenuFormSubmit,
  EditorBubbleMenuGroup,
  EditorBubbleMenuInput,
  EditorBubbleMenuPopover,
  EditorBubbleMenuPopoverContent,
  EditorBubbleMenuPopoverTrigger,
  EditorBubbleMenuSeparator,
  EditorButton,
  EditorButtonGroup,
  EditorContent,
  EditorDropdown,
  EditorLabel,
  EditorProvider,
  EditorSeparator,
  EditorToolbar,
} from "@/registry/editor/editor"

import { EditorCodeBlockExtension } from "@/registry/editor/editor-code-block"
import { EditorEssentialExtension } from "@/registry/editor/editor-essential"
import { EditorHighlightExtension } from "@/registry/editor/editor-highlight"
import { EditorImageExtension } from "@/registry/editor/editor-image"
import { EditorLinkExtensions } from "@/registry/editor/editor-link"
import { EditorPlaceholderExtension } from "@/registry/editor/editor-placeholder"
import { EditorSlashMenuExtension } from "@/registry/editor/editor-slash-menu"
import { EditorTableExtensions } from "@/registry/editor/editor-table"
import { EditorTaskListExtensions } from "@/registry/editor/editor-task-list"
import {
  Bold,
  Code2,
  Highlighter,
  ImageUp,
  Italic,
  Link2,
  List,
  ListOrdered,
  Redo,
  Strikethrough,
  Table,
  Underline,
  Undo,
} from "lucide-react"

const shouldShowTextBubbleMenu = ({
  editor,
  from,
  to,
}: {
  editor: Editor
  from: number
  to: number
}) => {
  if (from === to) return false
  if (editor.isActive("codeBlock")) return false
  if (editor.isActive("image")) return false
  return true
}

const INITIAL_CONTENT = `
<h1><em>Welcome</em> to the <mark class="bg-yellow-200 dark:bg-yellow-500 px-0.5 rounded">Editor</mark></h1>
<div class="react-renderer node-image" contenteditable="false" draggable="true"><div data-type="image" data-alignment="left" data-node-view-wrapper="" style="white-space: normal;" data-src="data:image/jpeg;base64," data-alt="612423082_17945291367100558_8340462856208547928_n.jpg"><figure class="my-4 flex w-full flex-col items-start"><div class="group relative inline-block"><img alt="612423082_17945291367100558_8340462856208547928_n.jpg" draggable="true" class="max-w-full" src="data:image/jpeg;base64," style="margin: 0px; object-fit: contain;"></div></figure></div></div>
<p>This is a <strong>rich text editor</strong> with all the features you need to create beautiful documents. Try out these features:</p>
<ul>
  <li>Type <code>/</code> to open the slash command menu</li>
  <li>Select text to see the formatting bubble menu</li>
  <li>Use the toolbar above for quick formatting</li>
</ul>
<p>Start typing to create your masterpiece...</p>
`

export default function EditorDemo() {
  return (
    <div className="mx-auto mb-32 max-w-6xl rounded-md border">
      <EditorProvider
        content={INITIAL_CONTENT}
        extensions={[
          EditorEssentialExtension,

          EditorTaskListExtensions,

          EditorPlaceholderExtension,

          EditorHighlightExtension,

          EditorImageExtension.configure({
            uploadStrategy: "base64",
            maxFileSize: 10 * 1024 * 1024, // 10MB
          }),

          EditorTableExtensions,

          EditorCodeBlockExtension,

          EditorLinkExtensions,

          EditorPlaceholderExtension,

          EditorHighlightExtension,

          EditorSlashMenuExtension,
        ]}
      >
        <EditorToolbar className="mb-10 flex items-center justify-center border-b px-4 py-2">
          {/* Undo/Redo */}
          <EditorButtonGroup>
            <EditorButton action="undo">
              <Undo className="size-4" />
            </EditorButton>
            <EditorButton action="redo">
              <Redo className="size-4" />
            </EditorButton>
          </EditorButtonGroup>

          <EditorSeparator />

          {/* Block Type Dropdown */}
          <EditorDropdown
            actions={[
              "paragraph",
              "heading1",
              "heading2",
              "heading3",
              "blockquote",
            ]}
          >
            <EditorLabel pattern=":label" />
          </EditorDropdown>

          <EditorSeparator />

          {/* Text Formatting */}
          <EditorButtonGroup>
            <EditorButton action="bold">
              <Bold className="size-4" />
            </EditorButton>
            <EditorButton action="italic">
              <Italic className="size-4" />
            </EditorButton>
            <EditorButton action="underline">
              <Underline className="size-4" />
            </EditorButton>
            <EditorButton action="strike">
              <Strikethrough className="size-4" />
            </EditorButton>
          </EditorButtonGroup>

          <EditorSeparator />

          {/* Highlight & Link */}
          <EditorButtonGroup>
            <EditorButton action="highlight">
              <Highlighter className="size-4" />
            </EditorButton>
            <EditorButton action="setLink">
              <Link2 className="size-4" />
            </EditorButton>
          </EditorButtonGroup>

          <EditorSeparator />

          {/* Lists */}
          <EditorButtonGroup>
            <EditorButton action="bulletList">
              <List className="size-4" />
            </EditorButton>
            <EditorButton action="orderedList">
              <ListOrdered className="size-4" />
            </EditorButton>
          </EditorButtonGroup>

          <EditorButtonGroup>
            <EditorButton action="setLink">
              <Link2 className="size-4" />
            </EditorButton>
            <EditorButton action="image">
              <ImageUp className="size-4" />
            </EditorButton>
            <EditorButton action="insertTable">
              <Table className="size-4" />
            </EditorButton>
            <EditorButton action="codeBlock">
              <Code2 className="size-4" />
            </EditorButton>
          </EditorButtonGroup>
        </EditorToolbar>

        <EditorContent className="prose dark:prose-invert mx-auto max-w-4xl rounded-md px-12 py-8" />

        <EditorBubbleMenu shouldShow={shouldShowTextBubbleMenu}>
          <EditorBubbleMenuContent>
            <EditorBubbleMenuGroup>
              <EditorBubbleMenuButton action="bold" title="Bold">
                <Bold className="size-3.5" />
              </EditorBubbleMenuButton>
              <EditorBubbleMenuButton action="italic" title="Italic">
                <Italic className="size-3.5" />
              </EditorBubbleMenuButton>
              <EditorBubbleMenuButton action="underline" title="Underline">
                <Underline className="size-3.5" />
              </EditorBubbleMenuButton>
              <EditorBubbleMenuButton action="strike" title="Strikethrough">
                <Strikethrough className="size-3.5" />
              </EditorBubbleMenuButton>
            </EditorBubbleMenuGroup>

            <EditorBubbleMenuSeparator />

            <EditorBubbleMenuButton action="highlight" title="Highlight">
              <Highlighter className="size-3.5" />
            </EditorBubbleMenuButton>

            <EditorBubbleMenuSeparator />

            <EditorBubbleMenuPopover>
              <EditorBubbleMenuPopoverTrigger asChild>
                <EditorBubbleMenuButton title="Add Link">
                  <Link2 className="size-3.5" />
                </EditorBubbleMenuButton>
              </EditorBubbleMenuPopoverTrigger>
              <EditorBubbleMenuPopoverContent align="end">
                <EditorBubbleMenuForm
                  className="flex gap-4"
                  onSubmit={(values, editor) =>
                    editor
                      ?.chain()
                      .focus()
                      .extendMarkRange("link")
                      .setLink({ href: values?.href })
                      .run()
                  }
                >
                  <EditorBubbleMenuInput
                    name="href"
                    binding="link.href"
                    placeholder="https://..."
                    type="url"
                  />
                  <EditorBubbleMenuFormActions>
                    <EditorBubbleMenuFormCancel />
                    <EditorBubbleMenuFormSubmit />
                  </EditorBubbleMenuFormActions>
                </EditorBubbleMenuForm>
              </EditorBubbleMenuPopoverContent>
            </EditorBubbleMenuPopover>
          </EditorBubbleMenuContent>
        </EditorBubbleMenu>
      </EditorProvider>
    </div>
  )
}
